import React from 'react';
import Layout from '../components/Layout'; 
function AdminDashboard() {
  return (
    <Layout>
      <h1>Admin Dashboard</h1>
      <p>Manage users, movies, and wishlists.</p>
    </Layout>
  );
}

export default AdminDashboard;
